function excluirService(a,o){$("#AWSRemoveLambdaModal").modal({backdrop:"static",keyboard:!1}).one("click","#delete",function(c){$.ajax({url:"/deletar-lambda",type:"DELETE",headers:{id:a,name:o},success:function(a){1==a.status?(alert("Lambda removido com sucesso"),location.reload()):(alert("Ops.. ocorreu um erro ao remover o lambda"),location.reload())}})})}function runLambda(a,o){"runLocal"==a?($("#name_function").html(o),$("#AWSLambdaRunLocal").modal({backdrop:"static",keyboard:!1})):"runDeploy"==a?($("#name_function_deploy").html(o),$("#AWSLambdaDeploy").modal({backdrop:"static",keyboard:!1})):alert("OPS")}$(function(){$.get("/dados-lambdas",function(a){$.each(a,function(){$("#table > tbody").append("<tr><td>"+this.id+"</td><td>"+this.nm_service+"</td><td>"+this.createdAt+'</td><td>  <a class="btn btn-danger" href="javascript:void(0)" onclick="excluirService('+this.id+", '"+this.nm_service+'\')">Excluir <i class="glyphicon glyphicon-trash"></i></a> &nbsp;<a class="btn btn-info" href="javascript:void(0)" onclick="runLambda(\'runLocal\', \''+this.nm_service+'\')">Rodar Lambda local <i class="glyphicon glyphicon-cog"></i> </a> &nbsp; <a class="btn btn-primary" href="javascript:void(0)" onclick="runLambda(\'runDeploy\', \''+this.nm_service+'\')">Deploy Lambda <i class="glyphicon glyphicon-cog"></i> </a> </td>NaN')})})});